import Avatar from "./Avatar";

export default function Profile({ person, size }) {
  <Card>
    <h2>{person.name}</h2>
  </Card>;
  console.log({ person });
  return (
    <Card>
      <h2>{person.name}</h2>
      <Avatar person={person} size={size} />
      <Recognitions recognitionList={person.recognitions} />
    </Card>
  );
}

function Card({ children }) {
  <section className="profile">{children}</section>;
}

function Recognitions({ recognitionArray }) {
  const itemList = recognitionArray.map((item) => (
    <li>
      <b>{item.title.charAt(0).toUpperCase() + item.slice(1)}</b>
      {item.description}
    </li>
  ));
  return <ul>{itemList}</ul>;
}

// img is avatar needs person(name,imgurl) and size
// section is card, needs person(profession,award,discovered)
